import React from 'react'

export function SearchForm() {
    return (
        <>
            <div>
                <input {...props} />
            </div>

            <div>
                <textarea {...props} />
            </div>

            <button {...props} >{props.children}</button>
        </>
    )
}
export default SearchForm;
